import { useEffect, useState } from 'react';
import "./Dashboard.css";

import Table from 'react-bootstrap/Table';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';

function Example() {
    const [show, setShow] = useState(false);
    const [product, setProduct] = useState([])
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [price, setPrice] = useState("");
    const [variant, setVariant] = useState("");
    const [id, setId] = useState("");

    useEffect(() => {
        getProduct();
    }, [])

    const getProduct = () => {
        axios.get('http://localhost:5002/notes')
            .then((res) => {
                setProduct(res.data.data);
                // console.log(res.data.data);
            })
    }





    return (
        <>
            <Button variant="primary" className='btn-1' onClick={handleShow}>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-plus" viewBox="0 0 16 16">
                    <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4" />
                </svg>
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Add Product</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <form onSubmit={handleCustomer}>
                        <FloatingLabel controlId="floatingPassword" label="Product Name" value={title} onChange={(e) => setTitle(e.target.value)}>
                            <Form.Control type="text" className="mb-3" />
                        </FloatingLabel>
                        <FloatingLabel controlId="floatingPassword" label="Variant" value={description} onChange={(e) => setDescription(e.target.value)}>
                            <Form.Control type="text" className="mb-3" />
                        </FloatingLabel>
                        <FloatingLabel controlId="floatingPassword" label="Discription" value={variant} onChange={(e) => setVariant(e.target.value)} >
                            <Form.Control type="text" className="mb-3" />
                        </FloatingLabel>
                        <FloatingLabel controlId="floatingPassword" label="Price" value={price} onChange={(e) => setPrice(e.target.value)}>
                            <Form.Control type="text" className="mb-3" />
                        </FloatingLabel>
                        <Button variant="secondary" onClick={handleClose}>
                            Close
                        </Button>
                        <Button variant="primary" type='submit' className='ms-3' onClick={handleClose}>
                            {id ? 'Update' : 'Add'}
                        </Button>
                    </form>
                </Modal.Body>
                <Modal.Footer>

                </Modal.Footer>
            </Modal >


            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Product Name</th>
                        <th>Discription</th>
                        <th>Variant</th>
                        <th>Price</th>
                    </tr>
                </thead>
                <tbody>
                    {product.map(data => (
                        <>
                            <tr key={data.id}>
                                <td>{data._id}</td>
                                <td>{data.title}</td>
                                <td>{data.description}</td>
                                <td>{data.variant}</td>
                                <td>{data.price}</td>
                                <Button variant="primary" onClick={() => userform(data)} >Edit</Button>
                                <Button variant="danger" onClick={() => handleDelete(data.id)} >Delete</Button>
                            </tr>
                        </>
                    ))}
                </tbody>
            </Table >
        </>
    );
}

export default Example;
